import React, { PureComponent } from "react";
import Title from "../pageTitle/title";
import VideoList from "../videoList/videoList";

class index extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <Title />
        <VideoList />
      </React.Fragment>
    );
  }
}

export default index;
